import React from 'react';
import '../styles/App.css';
import Footer from "../components/Footer";
import Navbar from '../components/Navbar';


const Home = () => {
  return (
    <>
      <div>
        <Navbar/>
        <div className="MyImage">
            <div class="typing-demo">
              <h2>Bienvenue sur mon site internet</h2>
            </div>
              <div class="animated-title">
              <div class="text-top">
                <div>
                  <span>Câ€™est avec un grand plaisir que je lance la mise en ligne de mon tout nouveau site Internet.<br/>je suis heureux de vous y accueillir. </span>
                </div>
              </div>
                <div class="text-bottom">
                <div>Bonne navigation !</div>
              </div>
              </div>
          <Footer/>
        </div>
      </div>
    </>
  );
};

export default Home;
